const Videos = () => {
    return (
        <div style={{marginRight:"30px"}}>

   {/* Filipa Pato Video */}
   <Header>Attach</Header>
   <Embed
    placeholder={'https://img.youtube.com/vi/_-Jj8MF2Ruw/0.jpg'}
    source='youtube'
  />

     {/* Chenin Video */}
     <Embed
    placeholder={'https://img.youtube.com/vi/zK4GGISFKJY/0.jpg'}
    source='youtube'
  />

        </div>
    );
};

export default Videos;
